import React from "react";

const frutis = [
  {
    id: 1,
    price: 9.99,
    name: "Banana",
    description: "Fresh Banana From Thailand",
    quantity: 1,
  },
  {
    id: 2,
    price: 7.99,
    name: "Apple",
    description: "Fresh Apple From Thailand",
    quantity: 3,
  },
  {
    id: 3,
    price: 8.99,
    name: "Mango",
    description: "Fresh Mango From Thailand",
    quantity: 2,
  },
];

const Cart = () => {
  return (
    <section className="cart-box">
      <h2>Carts</h2>
    </section>
  );
};

export default Cart;
